import React from "react";
import { ReactComponent as AddIcon } from "./add.svg";

const AddButton = ({ OnClick }) => {
  return (
    <div>
      <AddIcon
        style={{
          position: "absolute",
          left: "50%",
          top: "90%",
          transform: "translate(-50%, -50%) scale(0.15)",
          fill: "white"
        }}
        onClick={() => {
          OnClick();
        }}
      />
    </div>
  );
};

export default AddButton;
